import style from "./SubTitle.module.css";

function SubTitle(props) {
  return (
    <h2
      className={
        props.classColor
          ? `${props.classColor} ${style.subTitle}`
          : `${style.subTitle}`
      }
    >
      {props.children}
    </h2>
  );
}

export default SubTitle;
